(26, 3, 8, 'rErrList', '에러목록', 0, 'R', 'RTN_SELECT_LIST', 10, 'SELECT\n	ERRLOGSEQ, SESSIONID, REQID, ERRNO, ERRCD, ERRSTR, ERRFILE, ERRLINE, ERRCONTEXT, ADDDT, MODDT\nFROM\n	CG_ERRLOG\nORDER BY ERRLOGSEQ DESC\nLIMIT 0,100\n', NULL, '20160402134320', '20160407013939'),
