(97, 3, 4, 'selMasG', 'MAS', 8, 'R', 'RTN_SELECT_LIST', 0, 'select \n	PCD,PNM,PCDDESC,ORD\n	,UITOOL,USEYN,DELYN\n	,ADDDT,MODDT\nfrom \n	CG_CODE\norder by ORD asc', 0, '20180325192036', '20200312071151'),
