(132, 3, 65, 's2MonthG', 's2MonthG', 4, 'R', 'RTN_SELECT_LIST', 0, 'SELECT \n	CFM_SEQ, FROM_DT, TO_DT, CFM_DESC, ADD_DT\n	, ADD_ID\nFROM CMN_LOG_CFM\nORDER BY CFM_SEQ DESC', NULL, '20180511143012', NULL),
